import * as React from "react";
import {
  Routes,
  Route,
  Outlet,
  Link,
  useMatch,
  useResolvedPath,
} from "react-router-dom";
import ShopIng from "./pages/ShopIng";
import Shop from "./pages/Shop/Shop";



export default function App() {
  return (

    <div>

    <Routes>
      <Route path="/shop" element={<Shop/>} />
      <Route path="/" element={<ShopIng/>}> 
      </Route>
    </Routes>
  </div>

  );
}
